import { useEffect, useState } from "react";

import "../css/panel.css"

type CellProps = {
    row: number
}

const Cell : React.FC<CellProps> = ({row: number} : CellProps) => {
    const [neighbors, setNeighbors] = useState<[]>([]);

    return(
        <div className="cell">
        </div>
    )
}

export default function Panel() {
    const [grid, setGrid] = useState<JSX.Element[][]>();
    const [rows, setRows] = useState<number>(10);

    useEffect(() => {
        let tempOut : JSX.Element[][] = [];
        for (let j = 0; j < rows; j++) {
            let tempIn : JSX.Element[] = [];
            for (let i = 0; i < rows; i++) {
                tempIn.push(<Cell row={j} key={i}/>)
            }
            tempOut.push(tempIn);
        }
        setGrid(tempOut)
    }, [])

    return(
        <div className="panel">
            <div style={{ display: 'grid', gridTemplateColumns: `repeat(${rows}, 1fr)` }}>
                {grid?.map((cells) => {
                    return cells.map((cell, i) => {
                        return <div key={i}>{cell}</div>
                    })
                })}
            </div>
        </div>
    );
}
